import React from 'react'
import { useState,useEffect } from 'react';
import Card from './Card';
import Pages from '../pages/Pages';


function Popular({type}) {
  
  const [recipes,setRecipes] = useState([])
  useEffect(()=>{
    getRecipe(type);

  },[Pages])

  
  const getRecipe= async ()=>{
    const REACT_API_KEY ="e7704039751459e8dcd58cbf1daabddc"; //edamam api
    try{
      const response = await fetch(`https://api.edamam.com/api/recipes/v2?type=public&q=popular&app_id=af124d04&app_key=e7704039751459e8dcd58cbf1daabddc&dishType=Drinks`);
      const data = await response.json();
      setRecipes(data.hits);
      console.log(data);
      console.log(recipes);
    }
    catch(e){
      console.log(e);
    }
    
  }
  
  return (
    <div>
      {recipes.map((recipe,index)=>{
        return(
          <div key={index}>{recipe.recipe.label}</div>
        )
      })}
    </div>
  )
}

export default Popular;
